LOCAL
     n_segments : INTEGER := SIZEOF(c.segments);
   END_LOCAL;

   REPEAT k := 1 TO n_segments;
     IF (NOT('AP210_ELECTRONIC_ASSEMBLY_INTERCONNECT_AND_PACKAGING_DESIGN_MIM_LF.PCURVE' IN 
